import logo from '../../static/KPMG_logo_white.svg';
import upload_icon from '../../static/upload.png';
import React from 'react';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: theme.spacing(1),
    },
    input: {
        display: 'none',
    },
}));

export default function UploadBar() {
    const classes = useStyles();

    return (
        <div className='uploadbar_container'>
            <div><img src={logo} alt='kpmg_logo' style={{ width: '80px', float: 'left' }} /></div>
            <div className='container_div' style={{height:'20%'}}>
                <input accept="*" className={classes.input} id="upload-btn" multiple type="file" />
                <label htmlFor="upload-btn"><button style={{backgroundColor:'transparent', border:'none'}}>UPLOAD</button></label>
            </div>

        </div>
    );
};
